                                rp2 = classes[j].replace('(', '（')
                                rp2 = rp2.replace(')', '）')
                                index = class_size_data[class_size_data['班级名称'] == rp2].index.tolist(
                                )
                                if (len(index) != 0):
                                    index = index[0]
                                    to_arrive = class_size_data['实际人数'][index]  # 得到应到人数
                                    # 得到所属学院
